script: |
  super -f tsv -I q8494.sql | sort > q8494.out

vector: true

inputs:
  - name: q8494.sql
    data: |
      pragma pg
      SELECT DISTINCT 93 AS col1, 35 AS col2 FROM tab1 AS cor0 GROUP BY col0, col2, col2 HAVING NOT - col0 NOT BETWEEN + + NULLIF ( + SUM ( col0 ), + col2 + - - 10 + 31 * col2 ) AND - NULLIF ( - MIN ( ALL + 39 ), - + 26 );
  - name: tab1

outputs:
  - name: q8494.out
    data: |
